import React from 'react'

function Navbar() {
  return (
    <div className='n-wrapper'>
        <div className="n-left"></div>  {/*//创建左边导航栏  */}
            <div className='n-name'>宇恒</div>
            <span>toggle</span> {/* span是行内元素，等下添加切换按钮 */}
        <div className="n-right"></div> {/* //创建右边导航栏 */}
        <div className="n-list">
            <ul>{/* ul是无序列表 */}
                <li>home</li>   {/* 无序列表里面有每个列表 */}
                <li>penal</li>
                <li>divorce</li>
                <li>civil</li>
                <li>internacional</li>
                <li>mercantil</li>
                <li>despacho</li> {/* 等下记得在这个列表下再添加一个下拉菜单 */}
                <li>contacto</li>
            </ul>
        </div>
        <button className='Button'>
            Contect US
        </button>
    </div>
  )
}

export default Navbar
